import React from 'react';

class Pokemon extends React.Component {

  render() {

    const { pokeData } = this.propos;

    const result = pokeData.map((element) => (
      `Nome: ${element.name}`
      `Tipo: ${element.type}`
      `Peso médio: ${element.averageWeight}`
      `Foto: ${element.image}`
    ))

    return (
      result
    )
  }
}

export default Pokemon;
